import React from 'react';
import { Link } from 'react-router-dom';

const Payments = () => {
  // Mock data - replace with actual data from your backend
  const payments = [
    { id: 1, amount: '$5.99', date: '2024-06-07', method: 'Credit Card', status: 'Completed' },
    { id: 2, amount: '$3.99', date: '2024-06-12', method: 'Credit Card', status: 'Completed' },
    { id: 3, amount: '$4.99', date: '2024-06-17', method: 'Cash', status: 'Completed' },
  ];

  return (
    <div style={styles.container}>
      <h1>Payments List</h1>
      <button style={styles.createButton}>Create +</button>
      <table style={styles.table}>
        <thead>
          <tr>
            <th>ID</th>
            <th>Amount</th>
            <th>Date</th>
            <th>Method</th>
            <th>Status</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {payments.map((payment) => (
            <tr key={payment.id}>
              <td>{payment.id}</td>
              <td>{payment.amount}</td>
              <td>{payment.date}</td>
              <td>{payment.method}</td>
              <td>{payment.status}</td>
              <td>
                <button style={styles.actionButton}>Read</button>
                <button style={styles.actionButton}>Edit</button>
                <button style={styles.deleteButton}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  },
  createButton: {
    backgroundColor: 'green',
    color: 'white',
    padding: '10px 20px',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginBottom: '20px',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
  },
  tableHeader: {
    backgroundColor: '#f2f2f2',
  },
  tableData: {
    border: '1px solid #ddd',
    padding: '8px',
  },
  actionButton: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '5px 10px',
    marginRight: '5px',
    border: 'none',
    borderRadius: '3px',
    cursor: 'pointer',
  },
  deleteButton: {
    backgroundColor: '#dc3545',
    color: 'white',
    padding: '5px 10px',
    border: 'none',
    borderRadius: '3px',
    cursor: 'pointer',
  },
};

export default Payments;
